public String getRef_desc() {
com.egen.util.jdbc.JdbcUtil j = null;
try {
  if (lin_cdgo !=null && lin_cdgo.length()>0 && ref_cdgo !=null && ref_cdgo.length()>0) {
    j = new com.egen.util.jdbc.JdbcUtil();
    Ref db_object = new Ref();
    String[][] select = {
      {"ref_desc",null}
      };
    Object[][] where = {
      {"lin_cdgo","=",com.egen.util.text.FormatNumber.toInteger(lin_cdgo)},
      {"ref_cdgo","=",com.egen.util.text.FormatNumber.toInteger(ref_cdgo)},
      };
    String[] group = null;
    String[] having = null;
    String[] order = null;
    java.util.Vector results = j.select(db_object, select, where, group, having, order);
    if (results!=null && results.size()>0) {
      db_object = (Ref)results.elementAt(0);
      ref_desc = (db_object.getRef_desc()!=null)?db_object.getRef_desc()+"":"";
    } else {
      ref_desc = "";
    }
  }
} catch (Exception e) {
      ref_desc = "";
} finally {
  if (j!=null) { j.close(); }
}
return ref_desc;
}

