     if(inputfile2bl_form.getFileSize() > 512000){
        throw new Exception("O arquivo de imagem 1 ultrapassou o tamanho máximo de 500kb!");
     }
  }
  }



  Ref_combinacao_especial table = new Ref_combinacao_especial();

